import './App.css';
import {Router, Routes, Route} from "react-router-dom";
import Home from "./pages/Home";
import Canvas from './pages/canvas';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<Home />}/>
          <Route path="/canvas" element={<Canvas />}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
